// SearchPage.js
import React, { useState } from "react";
import "./styles/SearchPage.css";
import "./styles/HomePage.css";

function SearchPage() {
  const [searchText, setSearchText] = useState("");

  return (
    <div>
        <div className="back-button-container">
        <button className="back-button" onClick={handleBack}>&larr; Back</button>
      </div>
    <div className="search-container">
      <h2 className="search-title">Search Profiles</h2>

      <div className="search-bar">
        <input
          type="text"
          placeholder="Search Text Here"
          value={searchText}
          onChange={(e) => setSearchText(e.target.value)}
          className="search-input"
        />
      </div>

      <div className="side-buttons">
        <button className="side-button">Need Help?</button>
        <button className="side-button">Search</button>
        <button className="side-button">Filter</button>
      </div>
    </div>
    </div>
  );
}

export default SearchPage;
